SWCHWRM gaat over een jongen die graag schrijver wil worden en zijn belevenissen beschrijft. Hij gebruikt een schuilnaam, V. Swchwrm, omdat hij onbekend wil blijven. Hij beschrijft onder meer de dood van zijn opa en ontmoetingen met de koningin. SWCHWRM is gebaseerd op Mijn avonturen door V. Swchwrm van Toon Tellegen.




